import React, { useState, useEffect } from 'react';
import axios from 'axios';

const ListeChocolats = () => {
  const [chocolats, setChocolats] = useState([]);

  useEffect(() => {
    axios.get('https://your-api/chocolats')
      .then(response => response.json())
      .then(chocolatsData => {
        setChocolats(chocolatsData);
      });
  }, []);

  return (
    <div>
      {chocolats.map(chocolate => (
        <section key={chocolate.id}>
          <img src={require(`../images/${chocolate.image}`).default} alt={chocolate.title} />
          <h2>{chocolate.title}</h2>
          <p>Prix : {chocolate.price} â‚¬</p>
          <p>Note clients : {chocolate.note}</p>
          <span>Ajout au panier</span>
        </section>
      ))}
    </div>
  );
};

export default ListeChocolats;
